import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../../App.css';
import backgroundImg from '../../assets/background.jpg';
import exampleImg from '../../assets/damon.jpg';
import {Navbar} from '../index';

const Profile = () => {
  return (
    <React.Fragment>
      <Navbar />
      <div>
        <img src={backgroundImg} alt="background" className="background-image" />
        <div className="container">
          <div className="d-flex align-items-end profile-position">
            <img src={exampleImg} alt="profile" className="profile-image border" />
            <div className="d-flex flex-column">
              <span>Damon Joung</span>
              <span>5 Followers</span>
            </div>
            <button className="btn btn-danger h-25 ml-auto px-2 py-1">Follow</button>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
};

export default Profile;
